$(document).ready(function () {

	$(document).on('click', '.lazylink', function (e) {
		e.preventDefault();
		e.stopPropagation();
		var link = $(this);
		var href = link.attr('data-href');
		var target = link.attr('data-target');
		window.open(href, target).focus();
	});



	var splides = document.querySelectorAll('.splide3');
	if (splides.length > 0) {

		splides.forEach(function(splide, index) {

			var id = 'splide-' + index;
			splide_init_slider(splide);
			splide_init_fancybox(splide, id);

		});

	}


	function splide_init_slider(parent) {
		var splide = new Splide(parent, {
			type: 'loop',
			perPage: 3,
			perMove: 1,
			autoWidth: true,
			focus: 'center',
		});

		splide.mount();

		return splide;
	}

	function splide_init_fancybox(parent, id) {
		parent.querySelectorAll('.splide__slide:not(.splide__slide--clone) img').forEach(function(image, index) {
			var imgBig = image.src;

			let template = document.createElement('a');
			template.setAttribute('data-fancybox', id);
			template.href = imgBig;
			template.innerHTML = '<img src="' + imgBig + '" alt="">';
			image.after(template);
			image.remove();
		});

	}



	setTimeout(function () {
		$('.lazyload').each(function (item) {
			$(this).attr('src', $(this).attr('data-src'));
		});
		$('.lazyloadBG').each(function (item) {
			$(this).attr('style', 'background-image: url(' + $(this).attr('data-src') + ');');
		});
	}, 1500)


	$(document).on('click', '.js-undercut-toggler', function (event) {
		event.preventDefault();
		var toggler = $(event.currentTarget);
		var wrapper = toggler.closest('.js-undercut');
		var target = wrapper.find('.js-undercut-target');

		toggler.toggleClass('active');
		target.slideToggle(300);
	});



	$('.js-asanas-filter-button').on('click', function () {
		setTimeout(function () {
			var url = window.location.origin + '/asanas/';
			var groups = {};

			$('.js-asanas-filter:checked').each(function () {
				var $filter = $(this);

				if ($filter.val().length > 0) {
					var groupSection = $filter.val().split('|');

					if (!groups[groupSection[0]]) {
						groups[groupSection[0]] = [];
					}

					groups[groupSection[0]].push(groupSection[1]);
				}
			})

			var filters = [];
			if (Object.keys(groups).length > 0) {
				filters.push('filters[ASANAS]=' + JSON.stringify(groups));
			}

			if (filters.length > 0) {
				url = encodeURI(url + '?' + filters.join('&'));
			}

			window.location.replace(url)
		}, 0)
	})


	var isAsanasVariantsSliderLoop = $('.js-asana-variants-slider').find('.swiper-slide').length;
	var asanasVariantsSlider = new Swiper('.js-asana-variants-slider.v1', {
		slidesPerView: 1,
		spaceBetween : 26,
		loop         : false,
		freeMode     : true,
		navigation   : {
			nextEl: '.js-asana-variants-btn-next.v1',
			prevEl: '.js-asana-variants-btn-prev.v1',
		},
		breakpoints  : {
			1200: {
				slidesPerView: 4
			},
			900 : {
				slidesPerView: 3
			},
			620 : {
				slidesPerView: 2
			}
		}
	});
	var asanasVariantsSlider = new Swiper('.js-asana-variants-slider.v2', {
		slidesPerView: 1,
		spaceBetween : 26,
		loop         : false,
		freeMode     : true,
		navigation   : {
			nextEl: '.js-asana-variants-btn-next.v2',
			prevEl: '.js-asana-variants-btn-prev.v2',
		},
		breakpoints  : {
			1200: {
				slidesPerView: 4
			},
			900 : {
				slidesPerView: 3
			},
			620 : {
				slidesPerView: 2
			}
		}
	});

	$('.js-asanas-add').on('click', function (e) {
		e.preventDefault();

		var $button = $(this);
		var elementId = $button.data('element-id');

		$.post('/asanas/ajax.php?action=add', {ELEMENT_ID: elementId}, function (response) {
			if (response.result) {
				$button.html('Добавлено').removeClass('main-btn--purple js-asanas-add').on('click', function (e) {
					e.preventDefault()
				});
				//window.location.replace('/personal/asanas/');
			} else {
				if ($button.hasClass('catalog__item__add')) {
					$button.html(response.message);
				} else {
					if ($('.js-assan-error').length == 0) {
						var errorBlock = $('<div class="js-assan-error" style="margin-bottom: 10px; color: red;">' + response.message + '</div>');
						$button.before(errorBlock);
						setTimeout(function () {
							errorBlock.remove()
						}, 3000);
					}
				}
			}
		}, 'json');
	});

	$('.js-asanas-remove').on('click', function (e) {
		e.preventDefault();

		var $button = $(this);
		var elementId = $button.data('element-id');

		$.post('/asanas/ajax.php?action=remove', {ELEMENT_ID: elementId}, function (response) {
			if (response.result) {
				$button.parents('.my-asana').remove();
			}
		}, 'json');
	});

	var maxSliderItemHeight = 0;
	$('.main-slider .main-slider__item').each(function () {
		var $item = $(this)
		var itemHeight = $item.outerHeight();
		if (itemHeight > maxSliderItemHeight) {
			maxSliderItemHeight = itemHeight;
		}
	})

	if (maxSliderItemHeight > 0) {
		$('.main-slider .main-slider__item').css({'min-height': maxSliderItemHeight + 'px'})
	}

	$('input[type="tel"]').on('input', function () {
		const available_chars = '-+()_1234567890 ';
		const inputtedValue = $(this).val();
		var filtredValue = '';

		for (var i = 0; i < $(this).val().length; i++) {
			if (available_chars.includes(inputtedValue[i])) {
				filtredValue += inputtedValue[i];
			}
		}

		$(this).val(filtredValue);
	});

	$('.subscribe__form').on('submit', function (e) {
		e.preventDefault();

		$.post('/personal/subscribe/ajax.php', {EMAIL: $(this).find('input[type="email"]').val(), EVENT: $(this).find('input[type="hidden"]').val()}, function (responce) {
			if (responce.SUCCESS) {
				$('.subscribe__form-message').html(responce.MESSAGE).css('color', 'green').show();
			} else {
				$('.subscribe__form-message').html(responce.MESSAGE).css('color', 'red').show();
			}
		}, 'json');
	});
});

$(window).on('scroll', function (e) {
	var scrolled = $(window).scrollTop();

	if (scrolled >= 90) {
		$('body').addClass('page-scrolled');
	} else {
		$('body').removeClass('page-scrolled');
	}
});

